  [],\n\t\"revision_timestamp\": \"2015-05-06T22:38:38.425036\",\n\t\"name\": \"wire-insulation-incorporating-self-healing-polymers-wiisp-project-cb836\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NextGen and Virginia Tech are developing
  a self-healing material for wire insulation using a class of ionomeric polymers.
  \  These ionomers exhibit self-healing properties as a function of the ionic content
  of the material.  Previous work has focused on self-healing of puncture damage caused
  by projectiles, has shown that an airtight seal can be formed in real time seconds
  after the puncture has occurred.  rnrnSince self-healing has already been demonstrated,
  the major technical challenge of this effort is to stimulate the localized melt
  elastic response that has been shown to initiate self-healing.  Our concept is to
  incorporate a magnetically-responsive phase into the insulating polymer using magnetic
  flux particle alignment to induce localized heating during high-frequency excitation
  of the polymer.  Tuning the frequency of the electrical signal to the critical frequency
  of the polymer associated with the glass transition temperature will produce localized
  heating of the insulation. Localized heating, initiated by a wiring damage event
  such as arcing, will cause flow into the crack and, upon cooling, the crack will
  close over the wire and eliminate the exposure of the bare wire.  With proper arrangement
  of nanoparticles the impact on material property can be minimized, while site-specific
  self-healing can be demonstrated.rn\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
